use super::keccak::{keccak_absorb, keccak_squeezeblocks};

const SHAKE128_RATE: usize = 168;
const SHAKE256_RATE: usize = 136;

macro_rules! create_XOF {
    ($func_name:ident, $rate:expr) => {
        pub fn $func_name(output: &mut [u8], outlen: usize, input: &mut [u8], inlen: &mut usize) {
            let mut s = [0u64; 25];
            let mut d = [0u8; $rate];

            keccak_absorb(&mut s, $rate, &input, inlen, 0x1F);
            keccak_squeezeblocks(output, &mut (outlen / $rate), &mut s, $rate);

            if outlen % $rate != 0 {
                let start = (outlen / $rate) * $rate;
                keccak_squeezeblocks(&mut d, &mut 1, &mut s, $rate);
                for i in 0..outlen % $rate {
                    output[start + i] = d[i];
                }
            }
        }
    };
}


create_XOF!(shake128, SHAKE128_RATE);
create_XOF!(shake256, SHAKE256_RATE);


